import React, { Component } from 'react'

export class ModalScreen extends Component {

    render() {
        return (
            <div id="todo_modal">
                <div id="modal_yes_no_dialog">
                    <p>Delete list?</p>
                    <br></br>
                    <p>Are you sure you want to delete this list?</p>
                    <div id="modal_yes_no_dialog_button_container">
                        <button id="modal_yes_no_dialog_button_yes" onClick={this.deleteList}>YES</button>
                        <button id="modal_yes_no_dialog_button_no" onClick={this.hideModal}>NO</button>
                    </div>
                    <p>This list will not be retrievable.</p>
                </div>
            </div>
        )
    }
}

export default ModalScreen
